    private static RSAPublicKey rsaPublicKey;
    private static RSAPrivateKey rsaPrivateKey;
    private static int MAX_ENCRYPT_BLOCK = 117;
    private static int MAX_DECRYPT_BLOCK = 128;
    private static String algorithm = "RSA";
    static {
        // 1、初始化密钥
        KeyPairGenerator keyPairGenerator;
        try {
            keyPairGenerator = KeyPairGenerator.getInstance(algorithm);
            keyPairGenerator.initialize(1024);// 64的整倍数
            KeyPair keyPair = keyPairGenerator.generateKeyPair();
            rsaPublicKey = (RSAPublicKey) keyPair.getPublic();
            rsaPrivateKey = (RSAPrivateKey) keyPair.getPrivate();
            System.out.println("Public Key : " + Base64.encodeBase64String(rsaPublicKey.getEncoded()));
            System.out.println("Private Key : " + Base64.encodeBase64String(rsaPrivateKey.getEncoded()));
        } catch (NoSuchAlgorithmException e) {
            e.printStackTrace();
        }
    }
    
    public static RSAPublicKey getRsaPublicKey() {
		return rsaPublicKey;
	}
    
	public static RSAPrivateKey getRsaPrivateKey() {
		return rsaPrivateKey;
	}
	
	/**
    * @Title: RSAEncode
    * @Description: 将字符串加密
    * @param key
    * @param data
    * @return String
    */ 
    public static String RSAEncode(String data, RSAPublicKey publicKey) { 
	    byte[] b = data.getBytes(); 
	    try { 
		    int inputLen = b.length; 
		    ByteArrayOutputStream out = new ByteArrayOutputStream(); 
		    int offSet = 0; 
		    byte[] cache; 
		    int i = 0; 
		    Cipher cipher = Cipher.getInstance("RSA"); 
		    cipher.init(Cipher.ENCRYPT_MODE, publicKey); 
		    // 对数据分段解密 
		    while (inputLen - offSet > 0) { 
			    if (inputLen - offSet > MAX_ENCRYPT_BLOCK) { 
			    	cache = cipher.doFinal(b, offSet, MAX_ENCRYPT_BLOCK); 
			    } else { 
			    	cache = cipher.doFinal(b, offSet, inputLen - offSet); 
			    } 
			    out.write(cache, 0, cache.length); 
			    i++; 
			    offSet = i * MAX_ENCRYPT_BLOCK; 
		    } 
		    byte[] decryptedData = out.toByteArray(); 
		    out.close(); 
		    return Base64.encodeBase64String(decryptedData); 
	    } catch (Exception e) {
	    	e.printStackTrace();
	    }
	    return null; 
    }
    /**
    * @Title: RSADecode
    * @Description: 将字符串解密
    * @param key
    * @param encodedText
    * @return String
    */ 
    public static String RSADecode(String data, RSAPrivateKey privateKey) { 
	    try {
		    byte[] b = Base64.decodeBase64(data); 
		    int inputLen = b.length; 
		    ByteArrayOutputStream out = new ByteArrayOutputStream(); 
		    int offSet = 0; 
		    byte[] cache; 
		    int i = 0; 
		    Cipher cipher = Cipher.getInstance("RSA"); 
		    cipher.init(Cipher.DECRYPT_MODE, privateKey); 
		    // 对数据分段解密 
		    while (inputLen - offSet > 0) { 
			    if (inputLen - offSet > MAX_DECRYPT_BLOCK) { 
			    	cache = cipher.doFinal(b, offSet, MAX_DECRYPT_BLOCK); 
			    } else { 
			    	cache = cipher.doFinal(b, offSet, inputLen - offSet); 
			    } 
			    out.write(cache, 0, cache.length); 
			    i++; 
			    offSet = i * MAX_DECRYPT_BLOCK; 
		    } 
		    byte[] decryptedData = out.toByteArray(); 
		    out.close(); 
		    return new String(decryptedData); 
	    } catch (Exception e) {
	    	e.printStackTrace();
	    }
	    return null;
    }
    
